import React from "react";

const Modal = ({ isOpen, onClose, data }) => {
    if (!isOpen) return null;

    return (
        <div className="modal">
            <div className="modal-content">
                <span className="close" onClick={onClose}>&times;</span>
                {data ? (
                    <div>
                        {/* Render your data here */}
                        <h1>{data}</h1>
                    </div>
                ) : (
                    <p>Loading...</p>
                )}
            </div>
        </div>
    );
};

export default Modal;
